import{_ as e,o as a,c as n,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 32.1-268.1 Compilation and posting of marriage, divorce, and annulment data.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-268.1.md","filePath":"vacode/32.1-268.1.md"}'),i={name:"vacode/32.1-268.1.md"},r=t('<h1 id="§-32-1-268-1-compilation-and-posting-of-marriage-divorce-and-annulment-data" tabindex="-1">§ 32.1-268.1 Compilation and posting of marriage, divorce, and annulment data. <a class="header-anchor" href="#§-32-1-268-1-compilation-and-posting-of-marriage-divorce-and-annulment-data" aria-label="Permalink to &quot;§ 32.1-268.1 Compilation and posting of marriage, divorce, and annulment data.&quot;">​</a></h1><p>The State Registrar shall compile, publish, and make available to the public aggregate data on the number of marriages, divorces, and annulments from the year 2000 forward that occurred in the Commonwealth. The data shall be organized according to the locality in which the marriage license is issued or in which the divorce or annulment report is certified and shall include the age of the parties. In addition, the data on divorces and annulments shall include information regarding the number of minor children involved. The State Registrar shall post, update, and maintain this information on the Department website. Names, addresses, social security numbers, and any other personal identification information shall not be included.</p><p>2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0679" target="_blank" rel="noreferrer">679</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0209" target="_blank" rel="noreferrer">209</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0210" target="_blank" rel="noreferrer">210</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0211" target="_blank" rel="noreferrer">211</a>.</p>',3),o=[r];function l(d,s,c,h,m,g){return a(),n("div",null,o)}const _=e(i,[["render",l]]);export{f as __pageData,_ as default};
